import "./Categories.css";
import React, { useState } from "react";

function Categories() {
	const [SelectedCategory, SetSelectedCategory] = useState();

	return (
		<div className="Categories">
			<div
				className="CatBtn"
				id={"CatBtn" + 0}
				onClick={() => {
					document.getElementById(SelectedCategory).style.textDecoration =
						"none";
					document.getElementById("CatBtn" + this.id);
				}}
			>
				Category
			</div>
			<div className="CatBtn" id={"CatBtn" + 1}>
				Category
			</div>
			<div className="CatBtn" id={"CatBtn" + 2}>
				Category
			</div>
			<div className="CatBtn" id={"CatBtn" + 3}>
				Category
			</div>
		</div>
	);
}

export default Categories;
